import React from 'react'
import { Row, Form, Col, Button, Alert } from 'react-bootstrap'
import { Link } from 'react-router-dom'
import {Helmet} from "react-helmet";
import { useState, useEffect } from 'react'

export default function About() {
    useEffect(() => {
        const script = document.createElement('script');

        script.src = "https://platform.linkedin.com/badges/js/profile.js";

        script.async = true;

        document.body.appendChild(script);

        return () => {
            document.body.removeChild(script);
        }
    }, []);
    return (

        <div>
            <Form className="mt-5">
                <Row className="mt- justify-content-center">
                    <Col>
                    <div className="LI-profile-badge"  data-version="v1" data-size="medium" data-locale="en_US" data-type="horizontal" data-theme="dark" data-vanity="mohammad-aljagthmi-905323149"><a class="LI-simple-link" href='https://sa.linkedin.com/in/mohammad-aljagthmi-905323149?trk=profile-badge'>Mohammad Aljagthmi</a></div>
                    </Col>
                    <Col>
                    <div class="LI-profile-badge"  data-version="v1" data-size="medium" data-locale="en_US" data-type="horizontal" data-theme="dark" data-vanity="mohammad-aljagthmi-905323149"><a class="LI-simple-link" href='https://sa.linkedin.com/in/mohammad-aljagthmi-905323149?trk=profile-badge'>Mohammad Aljagthmi</a></div>
                    </Col>
                    <Col>
                    <div class="LI-profile-badge"  data-version="v1" data-size="medium" data-locale="en_US" data-type="horizontal" data-theme="dark" data-vanity="mohammad-aljagthmi-905323149"><a class="LI-simple-link" href='https://sa.linkedin.com/in/mohammad-aljagthmi-905323149?trk=profile-badge'>Mohammad Aljagthmi</a></div>
                    </Col>
                    <Col>
                    <div class="LI-profile-badge"  data-version="v1" data-size="medium" data-locale="en_US" data-type="horizontal" data-theme="dark" data-vanity="mohammad-aljagthmi-905323149"><a class="LI-simple-link" href='https://sa.linkedin.com/in/mohammad-aljagthmi-905323149?trk=profile-badge'>Mohammad Aljagthmi</a></div>
                    </Col>
                </Row>
            </Form>


            <Form>
                <Row className="justify-content-center mt-5">
                    <Col md={{ span: 4, offset: 2 }} >
                        <Button as={Link} to="/Home" variant="btn btn-outline-dark" md={6}>
                            Back Home
                    </Button>
                    </Col>
                </Row>
            </Form>

        </div >
    )
}
